    // Application Constructor
    initialize: function() {
        this.bindEvents();
    },
    // Bind Event Listeners
    //
    // Bind any events that are required on startup. Common events are:
    // 'load', 'deviceready', 'offline', and 'online'.
    bindEvents: function() {
        // wait for device API libraries to load
        document.addEventListener('deviceready', this.onDeviceReady, false);

        window.addEventListener('deviceready', this.analyticsAppOpen);
        window.addEventListener('resume', this.analyticsAppOpen);

        window.addEventListener('native.keyboardhide', this.toggleFooter);
        window.addEventListener('native.keyboardshow', this.toggleFooter);

        // wait for the database
        $(document).on('dbInstallConfirmed', this.onDbInstallConfirmed);

        // Open external links in the system browser
        //
        // If this code looks familiar/suspicious, it should. This is very similar
        // to the code we were using before to route requests through the query string,
        // which was subject to a race condition. One potentially significant
        // difference is that the event is different; I believe that mousedown
        // fires earlier than tap. I've also changed the internal/external check to
        // use indexOf instead a regex, which should also be faster. Mitigating the danger
        // to some extent is the fact if we do fall prey to a race condition, the app
        // won't crash. Instead the URL will be opened by the app webview rather
        // than the system browser, which isn't so bad.
        $(document).on('click', 'a', function(e) {
          var el = $(this);
          var url = el.attr('href');
          if (url && (url.indexOf('://') !== -1)) {
            e.preventDefault();
            window.open(url, '_system');
          }
        });

        // wire up off-canvas menu
        $('#toggle-offcanvas').bind('click', function (e) {
          $('.row-offcanvas').toggleClass('active');
          e.preventDefault();
        });

      $('#main').bind('click', function (e) {
        if ($('.row-offcanvas').hasClass('active') && $(e.target).attr("id") !== "toggle-offcanvas") {
          $('.row-offcanvas').removeClass('active');
          e.preventDefault();
        }
      });
        // any time a link is followed, close the off-canvas menu
        $('nav a').bind('click', function (el) {
              $('.row-offcanvas').removeClass('active');
            });

        // wire up swipes on the top navbar
        $('#navbar-top').bind('swipe', function (e) {
          var hdir = app.getSwipeDirection(e).horizontal;
          if (hdir === 'left') {
            $('.row-offcanvas').removeClass('active');
          } else if(hdir === 'right') {
            $('.row-offcanvas').addClass('active');
          }
        });

        // initialize modal widget
        $('#modal').modal({
          backdrop: 'static',
          show: false
        });

        // vertically center modals
        $('body').on('shown.bs.modal', '.modal', function(){
          var dialog = $(this).find('.modal-dialog');
          var total_height = $(window).height();
          var dialog_height = dialog.height();
          var margin = (total_height - dialog_height)/2;
          dialog.css('margin-top', margin);
        });

        //Prompt To Personalize behavior:
        $('body').on('click', '#promptPersonalizeContinue', function() {
          $('#promptPersonal').remove();
          routie('settings');
        });
    },
